    END,
    updatedat = NOW()
    WHERE symbol IN ('FPFD', 'DBEM', 'EMDM', 'FPXE', 'AOR', 'DEUS', 'FLMI', 'OCTD', 'SKYU', 'XHYD', 'CEMB', 'CA', 'FTHI', 'CTEC', 'MID', 'JPAN', 'FPXI', 'IWL', 'CHIQ', 'XMHQ');